import React from 'react';




class DalPage extends React.Component
{
  constructor(props)
  {
    super(props);

    this.state = {
      winLoss: false,
    }
    this.homeButton = this.homeButton.bind(this);
  }

  async componentDidMount()
  {
    const response = await fetch("/dal");

    const data = await response.json()

    console.log(data);
  }

  homeButton()
  {
    return (
      window.location.replace("/")
    )
  }

  render()
  {
    return (
      <>
        <h1>
          DFW PAGE!
        </h1>

        <button onClick={this.homeButton()}>
          HomePage
        </button>
      </>
    )
  }
};

export default DalPage;
